#include<bits/stdc++.h>
using namespace std;
long long countSubarrays(vector<int>& nums, int minK, int maxK) {
    int n=nums.size();
    deque<int> dqmin;
    deque<int> dqmax;
    int l=0;
    int res=0;
    int count[n+1]={0};
    for (int r=0;r<n;r++) {
    	while (!dqmin.empty()&&nums[dqmin.back()]>=nums[r]) dqmin.pop_back();
    	while (!dqmax.empty()&&nums[dqmax.back()]<=nums[r]) dqmax.pop_back();
    	dqmin.push_back(r); dqmax.push_back(r);
    	if (r) count[r]=count[r-1];
    	if (nums[r]<minK||nums[r]>maxK) count[r]=0;else count[r]++;
    	//cout<<"i="<<r<<"\ta[dqmin.front()]="<<nums[dqmin.front()]<<"\ta[dqmax.front()]"<<nums[dqmax.front()]<<endl;
		while(!dqmin.empty()&&nums[dqmin.front()]<minK) {
    		l++;
    		if (dqmin.front()<l) dqmin.pop_front();
    		if (!dqmax.empty()&&dqmax.front()<l) dqmax.pop_front();
		}
		while(!dqmax.empty()&&nums[dqmax.front()]>maxK) {
    		l++;
    		if (dqmax.front()<l) dqmax.pop_front();
    		if (!dqmin.empty()&&dqmin.front()<l) dqmin.pop_front();
		}
		if (dqmin.size()&&dqmax.size()&&nums[dqmin.front()]==minK&&nums[dqmax.front()]==maxK) res+=count[min(dqmax.front(),dqmin.front())];
	}
	
	return res;
}
